import {useHttp} from '../Hooks/http.hook';

export const getAllRopes = async () => {
    const {loading, error, request} = useHttp();
    const ropesInStock = await request('http://localhost:8000/api/ropes/getAllRopes', 'GET');
    return ropesInStock.data;
};
